// This code is designed to be used in an n8n Code node.
// It explicitly structures data field by field from the preceding nodes
// to create a clean, well-organized JSON object for an AI chatbot's context.
const userPersonalityInput = $('Get User Personality from DB').first().json;
const businessDetailsInput = $('Get a specific business').first().json;
const mergeReportsInput = $('Merge Reports').all().map(item => item.json);

// Use .all() to ensure you get all items from the preceding nodes
const audits = $('Get all Audits of this Business').all().map(item => item.json);
const taskGroups = $('Get all Audits Task groups').all().map(item => item.json).flat();

// Initialize the final context object with a structured schema.
const finalContext = {
  userPersonality: {},
  business: {},
  latestAudit: {},
  pastAudits: []
};

// Helper function to check if an object is not null and not empty.
const isObjectAndNotEmpty = (obj) => {
  return typeof obj === 'object' && obj !== null && Object.keys(obj).length > 0;
};

