  for (const mergedReport of mergeReportsInput) {
    if (isObjectAndNotEmpty(mergedReport.inboundReport) && mergedReport.inboundReport.task_group_id) {
      const inboundReportId = mergedReport.inboundReport.task_group_id;
      const inboundTask = taskGroups.find(task => task.id === inboundReportId);
      if (inboundTask) {
        const reportData = {};
        // Add each key one by one from the inbound report
        if (mergedReport.inboundReport.overall_summary) reportData.overall_summary = mergedReport.inboundReport.overall_summary;
        if (mergedReport.inboundReport.engagement_level) reportData.engagement_level = mergedReport.inboundReport.engagement_level;
        if (mergedReport.inboundReport.professionalism) reportData.professionalism = mergedReport.inboundReport.professionalism;
        if (mergedReport.inboundReport.script_adherence) reportData.script_adherence = mergedReport.inboundReport.script_adherence;
        if (mergedReport.inboundReport.issues_detected) reportData.issues_detected = mergedReport.inboundReport.issues_detected;
        if (mergedReport.inboundReport.positive_highlight) reportData.positive_highlight = mergedReport.inboundReport.positive_highlight;
        if (mergedReport.inboundReport.improvement_ideas) reportData.improvement_ideas = mergedReport.inboundReport.improvement_ideas;
