        if (mergedReport.inboundReport.answering_questions_score) reportData.answering_questions_score = mergedReport.inboundReport.answering_questions_score;
        if (mergedReport.inboundReport.ability_to_upsell_and_cross_sell_score) reportData.ability_to_upsell_and_cross_sell_score = mergedReport.inboundReport.ability_to_upsell_and_cross_sell_score;
        if (mergedReport.inboundReport.closing_for_appointment_and_call_to_action_score) reportData.closing_for_appointment_and_call_to_action_score = mergedReport.inboundReport.closing_for_appointment_and_call_to_action_score;
        if (mergedReport.inboundReport.overall_success_rate_out_of_100) reportData.overall_success_rate_out_of_100 = mergedReport.inboundReport.overall_success_rate_out_of_100;
        if (mergedReport.inboundReport.appointment_booked) reportData.appointment_booked = mergedReport.inboundReport.appointment_booked;
        if (mergedReport.inboundReport.initial_wait_time) reportData.initial_wait_time = mergedReport.inboundReport.initial_wait_time;
        if (mergedReport.inboundReport.on_hold_time) reportData.on_hold_time = mergedReport.inboundReport.on_hold_time;
        if (mergedReport.inboundReport.representative_tone) reportData.representative_tone = mergedReport.inboundReport.representative_tone;
        if (mergedReport.inboundReport.tone_consistency) reportData.tone_consistency = mergedReport.inboundReport.tone_consistency;
        if (mergedReport.inboundReport.clarity) reportData.clarity = mergedReport.inboundReport.clarity;
        if (mergedReport.inboundReport.accuracy) reportData.accuracy = mergedReport.inboundReport.accuracy;
        if (mergedReport.inboundReport.helpfulness) reportData.helpfulness = mergedReport.inboundReport.helpfulness;
        if (mergedReport.inboundReport.call_opening) reportData.call_opening = mergedReport.inboundReport.call_opening;
        if (mergedReport.inboundReport.questionaires) reportData.questionaires = mergedReport.inboundReport.questionaires;

        inboundTask.report = reportData;
      }
    }
    if (isObjectAndNotEmpty(mergedReport.outboundReport) && mergedReport.outboundReport.task_group_id) {
      const outboundReportId = mergedReport.outboundReport.task_group_id;
      const outboundTask = taskGroups.find(task => task.id === outboundReportId);
      if (outboundTask) {
        const reportData = {};
        // Add each key one by one from the outbound report
        if (mergedReport.outboundReport.overall_summary) reportData.overall_summary = mergedReport.outboundReport.overall_summary;
        if (mergedReport.outboundReport.engagement_level) reportData.engagement_level = mergedReport.outboundReport.engagement_level;
        if (mergedReport.outboundReport.professionalism) reportData.professionalism = mergedReport.outboundReport.professionalism;
        if (mergedReport.outboundReport.script_adherence) reportData.script_adherence = mergedReport.outboundReport.script_adherence;
        if (mergedReport.outboundReport.issues_detected) reportData.issues_detected = mergedReport.outboundReport.issues_detected;
        if (mergedReport.outboundReport.positive_highlight) reportData.positive_highlight = mergedReport.outboundReport.positive_highlight;
        if (mergedReport.outboundReport.improvement_ideas) reportData.improvement_ideas = mergedReport.outboundReport.improvement_ideas;
        if (mergedReport.outboundReport.agent_name) reportData.agent_name = mergedReport.outboundReport.agent_name;
        if (mergedReport.outboundReport.engagement_and_relationship_building_score) reportData.engagement_and_relationship_building_score = mergedReport.outboundReport.engagement_and_relationship_building_score;
        if (mergedReport.outboundReport.product_service_knowledge_and_education_score) reportData.product_service_knowledge_and_education_score = mergedReport.outboundReport.product_service_knowledge_and_education_score;
        if (mergedReport.outboundReport.answering_questions_score) reportData.answering_questions_score = mergedReport.outboundReport.answering_questions_score;
        if (mergedReport.outboundReport.ability_to_upsell_and_cross_sell_score) reportData.ability_to_upsell_and_cross_sell_score = mergedReport.outboundReport.ability_to_upsell_and_cross_sell_score;
        if (mergedReport.outboundReport.closing_for_appointment_and_call_to_action_score) reportData.closing_for_appointment_and_call_to_action_score = mergedReport.outboundReport.closing_for_appointment_and_call_to_action_score;
        if (mergedReport.outboundReport.overall_success_rate_out_of_100) reportData.overall_success_rate_out_of_100 = mergedReport.outboundReport.overall_success_rate_out_of_100;
        if (mergedReport.outboundReport.appointment_booked) reportData.appointment_booked = mergedReport.outboundReport.appointment_booked;
        if (mergedReport.outboundReport.initial_wait_time) reportData.initial_wait_time = mergedReport.outboundReport.initial_wait_time;
        if (mergedReport.outboundReport.on_hold_time) reportData.on_hold_time = mergedReport.outboundReport.on_hold_time;
        if (mergedReport.outboundReport.representative_tone) reportData.representative_tone = mergedReport.outboundReport.representative_tone;
        if (mergedReport.outboundReport.tone_consistency) reportData.tone_consistency = mergedReport.outboundReport.tone_consistency;
        if (mergedReport.outboundReport.clarity) reportData.clarity = mergedReport.outboundReport.clarity;
        if (mergedReport.outboundReport.accuracy) reportData.accuracy = mergedReport.outboundReport.accuracy;
        if (mergedReport.outboundReport.helpfulness) reportData.helpfulness = mergedReport.outboundReport.helpfulness;
        if (mergedReport.outboundReport.call_opening) reportData.call_opening = mergedReport.outboundReport.call_opening;
        if (mergedReport.outboundReport.questionaires) reportData.questionaires = mergedReport.outboundReport.questionaires;

        outboundTask.report = reportData;
      }
    }
  }
}

