// --- 2. Process Business Details with Null Safety ---
if (businessDetailsInput) {
  const business = {};
  if (businessDetailsInput.business_name) {
    business.businessName = businessDetailsInput.business_name;
  }
  if (businessDetailsInput.email) {
    business.email = businessDetailsInput.email;
  }
