  if (businessDetailsInput.phone_number) {
    business.phoneNumber = businessDetailsInput.phone_number;
  }
  if (businessDetailsInput.business_category) {
    business.category = businessDetailsInput.business_category;
  }
  if (businessDetailsInput.last_audited_at) {
    business.lastAuditedAt = businessDetailsInput.last_audited_at;
  }
  if (Object.keys(business).length > 0) {
    finalContext.business = business;
  }
}

// --- 3. Process All Audits and their Tasks (Separate Latest from Others) with Null Safety ---
if (audits && audits.length > 0 && businessDetailsInput && businessDetailsInput.current_audit_id) {
  const latestAuditId = businessDetailsInput.current_audit_id;
  const latestAudit = audits.find(audit => audit.id === latestAuditId);
  const otherAudits = audits.filter(audit => audit.id !== latestAuditId);

  // Process the latest audit if found
  if (latestAudit) {
    const latestAuditData = {};
    if (latestAudit.audit_type) latestAuditData.type = latestAudit.audit_type;
    if (latestAudit.status) latestAuditData.status = latestAudit.status;
    if (latestAudit.created_at) latestAuditData.createdAt = latestAudit.created_at;
    if (latestAudit.completed_at) latestAuditData.completedAt = latestAudit.completed_at;
    if (latestAudit.overall_score) latestAuditData.overallScore = latestAudit.overall_score;

    if (isObjectAndNotEmpty(latestAudit.insights)) {
      latestAuditData.insights = latestAudit.insights;
    }
    if (isObjectAndNotEmpty(latestAudit.recommendations)) {
      latestAuditData.recommendations = latestAudit.recommendations;
    }

    const latestAuditTasks = taskGroups.filter(task => task.audit_id === latestAudit.id);
    if (latestAuditTasks.length > 0) {
      latestAuditData.tasks = latestAuditTasks.map(task => {
        const taskObj = {};
        if (task.task_name) taskObj.taskName = task.task_name;
        if (task.status) taskObj.status = task.status;
        if (task.error_message) taskObj.errorMessage = task.error_message;
        if (task.report) taskObj.report = task.report;
        return taskObj;
      });
    }

    if (Object.keys(latestAuditData).length > 0) {
      finalContext.latestAudit = latestAuditData;
    }
  }

  // Process the other audits
  finalContext.pastAudits = otherAudits.map(audit => {
    const auditData = {};
    if (audit.audit_type) auditData.type = audit.audit_type;
    if (audit.status) auditData.status = audit.status;
    if (audit.completed_at) auditData.completedAt = audit.completed_at;
    if (audit.overall_score) auditData.overallScore = audit.overall_score;

    if (isObjectAndNotEmpty(audit.insights)) {
      auditData.insights = audit.insights;
    }
    if (isObjectAndNotEmpty(audit.recommendations)) {
      auditData.recommendations = audit.recommendations;
    }

    const auditTasks = taskGroups.filter(task => task.audit_id === audit.id);
    if (auditTasks.length > 0) {
      auditData.tasks = auditTasks.map(task => {
        const taskObj = {};
        if (task.task_name) taskObj.taskName = task.task_name;
        if (task.status) taskObj.status = task.status;
        if (task.error_message) taskObj.errorMessage = task.error_message;
        if (task.report) taskObj.report = task.report;
        return taskObj;
      });
    }

    return auditData;
  }).filter(audit => Object.keys(audit).length > 0);
}

// The n8n Code node requires the output to be a single item with the consolidated context.
return {
  context: finalContext
};

